import {authReducer} from "./authReducer";
import {selfDataReducer} from "./selfDataReducer";

export const rootReducer = () => ({
    auth: authReducer,
    // selfData: selfDataReducer,
});

export type RootState = ReturnType<typeof rootReducer>
